import React from "react";
import EmployeeList from "./EmployeeList";
import CreateEmployee from "./createEmployee";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

const App = () => {
  return (
    // Using Router for multiple pages
    <Router>
      <div style={{ backgroundColor: "blue", zIndex: "1000" }}>
        {/* Navbar */}
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
          <a className="navbar-brand" href="#">My App</a>
          <div className="navbar-nav">
            <Link className="nav-item nav-link" to="/get">Employee List</Link>
            <Link className="nav-item nav-link" to="/create">Create Employee</Link>
          </div>
        </nav>

        {/* Add some margin-top to avoid overlapping with navbar */}
        <div className="container" style={{ marginTop: "80px" }}>
          <Routes>
            <Route path="/get" element={<EmployeeList />} />
            <Route path="/create" element={<CreateEmployee />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
